const Contact = ({contact, handleChange}) => {
    
    return (
        <div>
            <p><img src={contact.avatar}/> | {contact.first_name} {contact.last_name} | <input type="checkbox" onChange={handleChange}/></p>
        </div>
    )
}

export default Contact;
